import React from 'react';
import styled from 'styled-components';

interface CardProps {
  imgUrl: string;
  name: string;
  population: string;
  region: string;
  capital: string;
}

const Card: React.FC<CardProps> = ({
  imgUrl,
  name,
  population,
  region,
  capital,
}: CardProps) => {
  return (
    <div>
      <Image src={imgUrl} alt={name} style={{}}></Image>
      <h3>{name}</h3>
      <p>
        <b>Population: </b> {population}
      </p>
      <p>
        <b>Region: </b> {region}
      </p>
      <p>
        <b>Capital: </b> {capital}
      </p>
    </div>
  );
};

export default Card;
